import { BrowserRouter, Route, Routes } from "react-router-dom";
import React, { createContext, useState } from "react";
import Login from "./components/Login/Login";
import Dashboard from "./components/Deshboard/Deshboard";
import Header from "./components/Header/Header";
import MainHeader from "./components/MainHeader/MainHeader";
import People from "./components/Sidebar/People";
import AddPeople from "./components/Sidebar/AddPeople";
import GlobalContext from "./components/GlobalContext/GlobalContext";
import Protected from "./components/Protected/Protected";

function App(props) {
  // const loginHandler = (email, password) => {
  //   // We should of course check email and password
  //   // But it's just a dummy/ demo anyways
  //   setIsLoggedIn(true);
  // };

  return (
    <GlobalContext>
      <BrowserRouter>
        <Routes>
          <Route exact path="/" element={<Login />} />

            <Route
              path="/dashboard"
              element={<Dashboard />}
            />
            <Route exact path="/logout" element={<Header />} />
            <Route exact path="/people" element={<People />} />
            <Route exact path="/addPeople" element={<AddPeople />} />
        </Routes>
      </BrowserRouter>
    </GlobalContext>
  );
}

export default App;
